import React from "react";

function OrderHistoryPage({orderHistory}){
    return (
        <ul className="order-history">
            {
                orderHistory.map(order => 
                <ul key={order.id} className="order">
                    <h3>Customer: {order.customer.name}</h3>
                    <h3>Items:</h3>
                    {
                        order.order_items.map(item => 
                            <li key={item.product.name}>{item.product.name} x{item.quantity}</li>)
                    }
                    <h3>Total: ${parseFloat(order.order_items.reduce(
                        (total, item) => total + item.product.price, 0
                        )).toFixed(2)}
                    </h3>
                </ul>)
            }
        </ul>
    )
}

export default OrderHistoryPage
